import React from "react";

function InputName() {
  return (
    <div className="container">
      <div className="alert alert-success fade show" role="alert">
        <h1>Alert</h1>
        <button
          className="btn-close"
          aria-label="close"
          data-bs-dismiss="alert"
        ></button>
      </div>
    </div>
  );
}

export default InputName;
